import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

export default class CarTable extends Component 
{


    render() {
        return (
                <table>
        <thead>
          <tr>
            <th>Model</th>
            <th>Colour</th>
            <th>Year</th>
            <th>Price</th>
            <th>&nbsp;</th>
          </tr>
        </thead>
        <tbody>
        {this.props.cars.map((car) => <CarTableRow obj={car}/>)}
        </tbody>
      </table>


        );
    }
}
